import React from 'react';
import Header from './components/Header';
import Footer from './components/Footer';
import './ReviewPage.css';

const ReviewBoard = () => {
    return (
        <>
        <Header />
        <br></br>
        <br></br>
        <ContentList text1="디즈니 플러스 완다비전 달리는 방"/>
        <br></br>
        <br></br>
        <Footer />
        </>
    );
};

export default ReviewBoard;
